int bisect_left(List<List<int>> stacks, int value) {
  int low = 0;
  int high = stacks.length;
  while (low < high) {
    int mid = (low + high) ~/ 2;
    List<int> stack = stacks[mid];
    int top_idx = stack.length - 1;
    int top = stack[top_idx];
    if (top < value) {
    low = mid + 1;
  } else {
    high = mid;
  }
  }
  return low;
}

List<int> reverse_list(List<int> src) {
  List<int> res = <int>[];
  int i = src.length - 1;
  while (i >= 0) {
    res = [...res, src[i]];
    i = i - 1;
  }
  return res;
}

